---@class Networking.UnityWebRequest.Result @Defines codes describing the possible outcomes of a UnityWebRequest.
---@field DataProcessingError fun() @Error processing data. The request succeeded in communicating with the server, but encountered an error when processing the received data. For example, the data was corrupted or not in the correct format.
---@field ProtocolError fun() @The server returned an error response. The request succeeded in communicating with the server, but received an error as defined by the connection protocol.
---@field Success fun() @The request succeeded.
---@field InProgress fun() @The request hasn't finished yet.
---@field ConnectionError fun() @Failed to communicate with the server. For example, the request couldn't connect or it could not establish a secure channel.
